-- // edit but be careful
mtpData = {
	
	--[[ 
	
	-- // How this goes:
	
	-- the model we selected in editor
	[selectedModel] = {
		
		-- FIRST THINGS FIRST, YOU NEED TO ADD OFFSETS FOR THE ORIGINAL MODEL:
		
		{selectedModel, {{...}, {...}, {...}, {...}}}, -- default
	
		-- the model being spawned 		-- every table content here has X, Y, Z, [ RX, RY, RZ ] offset coords/rot from the original model
		{previewModel, 					{{...}, {...}, {...}, {...}}},
		
		-- model, X direction, -X direction, Y, -Y, .. extras ..
		{previewModel, {{...}, {...}, {...}, {...}, {...}, {...}, {...}, {...}, {...}, {...}, {...}, {...}}},
	}
	-- //
	
	-- // For building features:
	[selectedModel] = {
		{selectedModel, {{...}, {...}, {...}, {...}}}, -- default
		{NIGHTWINDOW_MODEL, {{TABLE_EXACT COORDS}, {TABLE_EXACT COORDS}, {TABLE_EXACT COORDS}, {TABLE_EXACT COORDS}}},
		{extra, { .. extra .. }},
		{...},
		{...},
		
		-- most inputs here have all of the 4 axis the same table, so that any bind will spawn it on the same spot.
	}
	-- //
	
	-- // How to add new offsets:
	
			Go into editor and spawn an object at 0, 0, 100, then spawn another object you'd want as adjacent in MT+
			Set position and rotation accordingly, then copy the data from F3 and add them in a sub-table here.
			Profit.
		
		OR
		
			Make your own offset output system you lazy fuck
	-- //
	]]
	
