-- // DEVELOPER COMMANDS

local offsetX, offsetY, offsetZ = 0, 0, 0

addCommandHandler("getbounds", function(cmd, id)
	local selected = exports["editor_main"]:getSelectedElement()
	if selected and isElement(selected) then
		local id = getElementModel(selected)
		local minX, minY, minZ, maxX, maxY, maxZ = getElementBoundingBox(selected)
		local output = string.format("{%s, {{%.03f, 0, 0}, {%.03f, 0, 0}, {0, %.03f, 0}, {0, %.03f, 0}, {0, 0, %.03f}, {0, 0, %.03f}}},", tostring(id), float(maxX*2), float(minX*2), float(maxY*2), float(minY*2), float(maxZ*2), float(minZ*2))
		outputChatBox(output)
		return true
	end

	local id = tonumber(id)
	if id then
		local boundingElement = createObject(id, 0, 0, 0)
		if boundingElement then
			local minX, minY, minZ, maxX, maxY, maxZ = getElementBoundingBox(boundingElement)
			local output = string.format("{%s, {{%.03f, 0, 0}, {%.03f, 0, 0}, {0, %.03f, 0}, {0, %.03f, 0}, {0, 0, %.03f}, {0, 0, %.03f}}},", tostring(id), float(maxX*2), float(minX*2), float(maxY*2), float(minY*2), float(maxZ*2), float(minZ*2))
			outputChatBox(output)
			--setClipboard(output)
			destroyElement(boundingElement)
		else
			outputChatBox("no valid object")
		end
	else
		outputChatBox("please add model id")
	end
	
end)

addCommandHandler("getoffset", function()
	local selected = exports["editor_main"]:getSelectedElement()
	if selected and isElement(selected) then
		local id = getElementModel(selected)
		local x, y, z = getElementPosition(selected)
		x = x - offsetX
		y = y - offsetY
		z = z - offsetZ
		local rx, ry, rz = getElementRotation(selected)
		if rx == 0 and ry == 0 and rz == 0 then
			local rotoutput = string.format("{%.04f, %.04f, %.04f}, ", float(x), float(y), float(z))
			outputChatBox(string.gsub("{"..tostring(id)..", {"..string.rep(rotoutput, 4).."}},", "}, }}", "}}}"))
		else
			outputChatBox(string.format("{%s, {{%.04f, %.04f, %.04f, %.04f, %.04f, %.04f}}},", tostring(id), float(x), float(y), float(z), float(rx), float(ry), float(rz)))
		end
	else
		outputChatBox("no selected element")
	end
end)

addCommandHandler("setoffset", function(cmd, x, y, z)
	local selected = exports["editor_main"]:getSelectedElement()
	if selected and isElement(selected) then
		local x, y, z = getElementPosition(selected)
		offsetX, offsetY, offsetZ = x, y, z
		outputChatBox("new offsets applied from selection")
		return true
	end
	local x, y, z = tonumber(x), tonumber(y), tonumber(z)
	if x and y and z then
		offsetX, offsetY, offsetZ = x, y, z
		outputChatBox("new offsets applied")
	else
		outputChatBox("error, invalid args")
	end
end)

-- // Used for efficient saving
function float(number)
	return math.floor( number * 10000 ) * 0.0001
end
